import React from 'react';

function TopicList({ topics }) {
    return (
        <div className="topic-list">
            {topics.map(topic => (
                <div key={topic._id} className="topic">
                    <h2>{topic.title}</h2>
                    <p>By: {topic.createdBy}</p>
                </div>
            ))}
        </div>
    );
}

export default TopicList;
